A BERSALAH]
.
Kalo lagi ngelakuin sesuatu, ada kalanya tiba-tiba ngerasa ada yang ngganjel. Macem gini-gini lah:
"Ini bener nggak ya?"
"Yang barusan dosa nggak ya?"
"Halal nggak sih?"
.
Jangan remehkan rasa bersalah, ia layaknya alarm yang memberi peringatan bagi kita bahwa apa yang kita lakukan menyalahi fitrah, menyalahi kebenaran. Rasulullah shalallahu 'alaihi wasallam juga pernah bersabda yang intinya kalo lagi bingung terhadap suatu perbuatan, coba tanyakan pada hati nurani. Karena memang fitrahnya manusia itu punya kecenderungan terhadap kebaikan 💓
.
Jadi, jaga hati kita baik-baik ya. Hati kita terlalu berharga untuk disinggahi rasa iri, dengki, ujub, riya, dan penyakit hati lainnya. Jangan sampai penyakit-penyakit seperti itu numpuk di hati yang akhirnya bikin hati kita mengeras. 💔😓
.
Kalau hati sudah keras? Duh, bahaya banget... Hidayah, cahaya dari Allah bakal susah banget untuk sampai. Orang yang hatinya mengeras bakal semakin jauh dari fitrahnya, menjadi mudah cenderung pada keburukan. 😭
Na'udzubillahi min dzalik... 

